import React, { useState } from 'react';


const Register = ({onRouteChange}) => {

	const [registrationDetails, setRegistrationDetails] = useState({
		registerFirstName: '',
		registerLastName: '',
		registerEmail: '',
		registerPassword: ''
	});
	const [userID, setUserID] = useState(null);

	const registerSubmit = async () => {
		let register = await fetch('http://localhost:3001/register', {
			method: 'post',
			headers: { 'Content-type': 'application/json'},
			body: JSON.stringify({
				first_name: registerFirstName,
				last_name: registerLastName,
				email: registerEmail,
				password: registerPassword
		})
	})
		register = register.json();
		console.log(register);
}

	return (
		<div className="ui container">
			<form className="ui form" id="register-form">
				<h1 style={{margin: '0 auto', textAlign: 'center', padding: '1rem 0'}}>Register</h1>
				<div className="field">
					<label>First Name</label>
					<input type="text" name="first-name" placeholder="First Name"/>
				</div>
				<div className="field">
					<label>Last Name</label>
					<input type="text" name="last-name" placeholder="Last Name"/>
				</div>
				<div className="field">
					<label>Email</label>
					<input type="text" name="email" placeholder="Email"/>
				</div>			
				<div className="field">
					<label>Password</label>
					<input type="text" name="password" placeholder="Password"/>
				</div>	
				<div className="field" style={{display: 'flex', justifyContent: 'center'}}>		
					<button 
						onClick={onRegisterSubmit}
						className="ui button" 
						type="submit" 
						style={{color: 'rgb(0 0 0 / 91%)'}}
						>Register
					</button>
				</div>
			</form>
		</div>
	)
}

export default Register;
